import React from 'react';
import style from 'styled-components';

const StyledIndexPage = style.div`
	display: flex;
	height: 100%;
`

const StyledBlockRole = style.div`
	display: flex;
	background: linear-gradient(to top, ##5454E2, ##924FD1);
	justify-content;
	height: 100%;
	width: 50%;
`

const BlockRole = ( { role } ) => {
	return(
		<StyledBlockRole>
			{role}
		</StyledBlockRole>
	)
}

const IndexPage = () => {
	return(
		<StyledIndexPage>
			<BlockRole role="avtor" />
			<BlockRole role="redarctor"/>
		</StyledIndexPage>
	)
}

export default IndexPage
